script: |
  super -f text -I q1566.spq | sort > q1566.out

inputs:
  - name: q1566.spq
    data: |
      SELECT ALL - 91 AS col2 FROM tab1 (FORMAT parquet) WHERE - col2 * col0 IS NULL AND ( NOT NULL IN ( - col1, col2, + 73 / - + col0 + - + col2 ) );
  - name: tab1

outputs:
  - name: q1566.out
    data: |
